import React from "react";
import { Button } from "semantic-ui-react";

class ButtonExampleGroup extends React.Component {
  styles = {
    margin: "20px",
    width: "175px",
    height: "60px",
  };
  state = { active: 0 };

  click(val) {
    this.setState({ active: val });
  }

  render() {
    return (
      <div>
        <Button.Group>
          <Button
            style={this.styles}
            className="main-btn btn-filled"
            onClick={() => this.click(1)}
            active={this.state.active === 1}
          >
            One
          </Button>
          <Button
            style={this.styles}
            className="main-btn btn-border"
            onClick={() => this.click(2)}
            active={this.state.active === 2}
          >
            Two
          </Button>
        </Button.Group>
        <Button.Group>
          <Button
            style={this.styles}
            className="main-btn btn-border"
            onClick={() => this.click(3)}
            active={this.state.active === 3}
          >
            Three
          </Button>
          <Button
            style={this.styles}
            className="main-btn btn-filled"
            onClick={() => this.click(4)}
            active={this.state.active === 4}
          >
            Three
          </Button>
        </Button.Group>
        <Button.Group>
          <Button
            style={this.styles}
            className="main-btn btn-filled"
            onClick={() => this.click(5)}
            active={this.state.active === 5}
          >
            Three
          </Button>
          <Button
            style={this.styles}
            className="main-btn btn-border"
            onClick={() => this.click(6)}
            active={this.state.active === 6}
          >
            Three
          </Button>
        </Button.Group>
      </div>
    );
  }
}
export default ButtonExampleGroup;
